    "2013-03-15T22:29:46.879993",nt"name": "the-geology-of-the-enosburg-area-vermont",nt"isopen":
    false,nt"url": null,nt"notes": "This resource is available as a downloadable
    file, ESRI Service, and as a Web Feature service. Resource includes a Geologic Map,
    Minor Structures and Air Photograph Linears for the Enosburg Falls Quadrangle, Minor
    Structures and Air Photograph Linears for the Jay Peak Quadrangle, and a text on
    Bedrock geology for the Enosburg area, Vermont. Abstract: The area here described
    extends broadly from the Hinesburg thrust in the west, to the west flank of the
    Green Mountain anticlinorium to the east. The central feature is the Enosburg anticlinorium.
    The Oak Hill succession in Vermont is re-defined as a result of recent work. To
    the west, the succession is miogeosynclinal in character, and easily classified.
    It changes eastward into a cugeosvnclinal sequence difficult to classify stratigraphically.",nt"license_title":
